const stylee = () => {
      return {
        color: "Red",
        textAlign: "center",
        fontFamily: "Poppins",
        fontSize: "16px",
        fontStyle: "normal",
        fontWeight: "500",
        lineHeight: "32px",
      };
  };
  
  export default stylee;
